Row.code:
// 検査基準
var inspection = me.GetDataByName({
	name: TestData /* STRING */
});

var result = "NG";

if (inspection.getRowCount()>0) {
	// PLCデータ
    var query = {
    	"filters": {
    		"type": "GT",
    		"fieldName": "Simulation_Examples_Functions_Ramp4",
    		"value": parseInt(inspection.value,10)-1
    	}
    };
    var plcData = Things["MEL.Kepware.TH"].QueryPropertyHistory({
    	oldestFirst: undefined /* BOOLEAN */,
    	maxItems: 1 /* NUMBER {"defaultValue":500} */,
    	endDate: undefined /* DATETIME */,
    	propertyNames: undefined /* INFOTABLE {"dataShape":"EntityList"} */,
    	query: query /* QUERY */,
    	startDate: undefined /* DATETIME */
    });
    if (plcData.getRowCount()>0 && plcData.Simulation_Examples_Functions_Ramp4>inspection.value) {
        result = "OK";
    }
}
me.InsertTestData({
	TestData: TestData /* STRING [Required] */,
	Result: result /* STRING */
});
